import logo from './logo.svg';
import './App.css';

function App() {
  const heading = <h1>Bem-vindo,</h1>;
  const message = <p>Novo App em construção</p>;
  const logotipo = <img src={logo} width="100px" />;
  const lista = ["Marcos","Maria","Mateus"];
  const numeros = [1,2,3,9]
  const soma = numeros.reduce((accumulator,currentValue) => accumulator + currentValue);

  return (
    <div>
      {logotipo}
      {heading}
      {message}
      <ul>
      {lista.map((e)=><li><p>{e}</p></li>)}
      </ul>
      <h2>Soma dos números:</h2>
      <ul>
      {numeros.map((e)=><li><p>{e}</p></li>)}
      </ul>
      <p>Total: {soma}</p>

    </div>);
}

export default App;
